export default class APIUser{

    static AutenticaUser (body){
        
            return fetch(`http://localhost:5000/login`,{
            method: 'POST',
            headers : {
                'Content-Type':'application/json',
                "Accept" :'application/json' 
                },
            body: JSON.stringify(body)
            
        })
        .then(response => response.json())
    }

}
